import React from "react";
import './Search.css'
function SearchResultItem(props) {
  const {data} = props;
  console.log(data) ;
  return (
    <div>
      <div className="search-result">
        <div className="left">
          {/* <img
            src={data.image.url}
            alt="Hero"
          /> */}
          <img src="https://www.superherodb.com/pictures2/portraits/10/100/10441.jpg" alt="" />
        </div>
        <div className="right">
          {/* <h1>{data.name}</h1> */}
          <h1>App</h1>
          <h4>{data.biography['full-name']}</h4>
          <div className="stats">
            {/* <div>Strength {data.powerstats.strength}</div>
            <div>Strength {data.powerstats.speed}</div>
            <div>Strength {data.powerstats.power}</div> */}
          </div>
        </div>
      </div>
    </div>
  );
}

export default SearchResultItem;
